import { useState } from "react"

export const TicketPlayground = () => {

	const [command, setCommand] = useState({})

	const handleInput = event => {
		setCommand({
			...command,
			[event.target.name] : event.target.value
		})
	}

  return (
    <div>
      <h3>Playground</h3>

			{[
				{name: "kitchen"},
				{name: "date"},
			 	{name: "time"},
			 	{name: "waiter"},
			 	{name: "table"}
			].map(input => 
				<input type="text" value={input.value} name={input.name} onChange={handleInput}/>
			)}

				{JSON.stringify(command)}

    </div>
  );
}
